import styled from "styled-components";

const Head=styled.header`
height:60px;
background-color: #8a2b06;
padding:10px;
display:flex;
justify-content:space-between;

.logo{
height:30px;
margin-left:115px;
color:white;
}
button{
    display:block;
    margin-right:115px;
}
`
const Image=styled.div`
width:100%
`

export {Head,Image}
